import React from 'react'
import { CaFoundation, MbaCourses, PgCourses, UgCourses } from './LandingPageData'
import {BgImg} from './Landing-imges/onlineEd.jpg'
import './LandingPage.css'
import { Link } from 'react-router-dom'

export const LandingPage = () => {
  return (
    <div className='BgImage' >
        <div style={{display: 'flex'}}>

            <div className='UgCourses'>
                {UgCourses.map(((itemm) => {
                    return(
                    <ul>
                        <Link><li>{itemm}</li></Link>
                    </ul>
                    )
                }))}
            </div>

            <div className='PgCourses'>
                {PgCourses.map(((itemm) => {
                    return(
                    <ul>
                    <Link><li>{itemm}</li></Link>
                    </ul>
                    )
                }))}
            </div>

            <div className='MbaCourses'>
                {MbaCourses.map(((itemm) => {
                    return(
                    <ul>
                    <Link><li>{itemm}</li></Link>
                    </ul>
                    )
                }))}
            </div>

            <div className='CaCourses'>
                {CaFoundation.map(((itemm) => {
                    return(
                    <ul>
                    <Link><li>{itemm}</li></Link>
                    </ul>
                    )
                }))}
            </div>



        </div>


    </div>

  )
}
